  return (
    <>
    <div className='bigDiv'>
      <div className='intro'>

        <h1 className='header'>We Are Midwest Math Circle</h1>
        <button>{"Register Now"}</button>

      </div>

      <Slider />
    </div>

    <div className='bigDiv'>

      <div className="aboutImageDiv">
        {/* <img src={require("../Images/download.jpeg")} alt='hi' className="aboutImg"/> */}
      </div>

      <div className='aboutTextDiv'>
        <h1>About Us</h1>
        <h3>As Albert Einstein once said, "Education is not the learning of facts but the training of minds to think". At MWMC, we embody this philosophy. 
        We grew frustrated with the approach schools take to math </h3>
      </div>

    </div>
    </>
  );
}

export default MainPage;
